import React from 'react';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import UserForm from './Register/user';
const App = () => {
  return (
    // <div>
    //   <h1>Create a new user</h1>
    //   <UserForm />
    // </div>
            <Router>
            <Routes>
                <Route exact path="/" element={<Login />}/>
                <>
                    <Route exact path="/Register" element={<Register/>}/>
                </>
                <>
                    <Route exact path="/:user_id/SellerHome" element={<ProductList/>}/>
                    <Route exact path="/:user_id/Product" element={<ProductList/>}/>
                    <Route exact path="/:user_id/createProduct" element={<Product/>}/>
                    <Route path="/Product/:user_id/edit/:id" element={<ModifyProduct />} />
                    <Route exact path="/Dashboard" element={<Dashboard/>}/>
                </>
                <>
                    <Route exact path="/Home/:user_id" element={<CustomerHome/>}/>
                    <Route exact path="/Cart/:user_id" element={<CartPage/>}/>
                    <Route exact path="/Items/:user_id" element={<Items/>}/>
                    <Route exact path="/Orders" element={<OrderTracking/>}/>
                </>
                <>
                    <Route exact path="/AdvertiserHome/:user_id" element={<AdvertiserHome/>}/>
                </>
            </Routes>
        </Router>
  );
};

export default App;
